label {
  font-size: 1rem;
}
.main-content {
	width:100%;
}

.tabs {
  position: relative;
  min-height: 700px;
  margin: 2rem auto;
  max-width: 100%;
}

.tab {
  float: left;
}

.tab label {
    background: #eee;
    padding: 10px 30px;
    border: 1px solid #ccc;
    margin-left: -1px;
    position: relative;
    left: 1px;
    cursor: pointer;
    min-height: 0px;
    line-height: 10px;
}

.tab [type="radio"] {
  display: none;
}

.content {
  position: absolute;
  top: 31px;
  left: 0;
  right: 0;
  bottom: 0;
  background: white;
  overflow: auto;
  padding: 20px;
  border: 1px solid #ccc;
}

[type="radio"]:checked ~ label {
  background: #fff;
  border-bottom: 1px solid #fff;
  z-index: 2;
}

[type="radio"]:checked ~ label ~ .content {
  z-index: 1;
}

/*** Modal ***/
.modal {
  opacity: 0;
  visibility: hidden;
  position: fixed;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  text-align: left;
  background: rgba(0, 0, 0, 0.8);
  transition: opacity 0.2s ease;
  z-index: 100;
}

.modal__bg {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  cursor: pointer;
}

.modal-state {
  display: none;
}

.modal-state:checked + .modal {
  opacity: 1;
  visibility: visible;
}

.modal-state:checked + .modal .modal__inner {
  top: 0;
}

.modal__inner {
  transition: top 0.25s ease;
  position: absolute;
  top: -20%;
  right: 0;
  bottom: 0;
  left: 0;
  width: 75%;
  margin: auto;
  overflow: auto;
  background: #fff;
  border-radius: 6px;
  padding: 1rem 2rem 2rem 2rem;
  height: 75%;
}

.modal__close {
  position: absolute;
  right: 1rem;
  top: 1rem;
  width: 1rem;
  height: 1rem;
  cursor: pointer;
}

.modal__close:after,
.modal__close:before {
  content: "";
  position: absolute;
  width: 2px;
  height: 1.5em;
  background: #ccc;
  display: block;
  transform: rotate(45deg);
  left: 50%;
  margin: -3px 0 0 -1px;
  top: 0;
}

.modal__close:hover:after,
.modal__close:hover:before {
  background: #aaa;
}

.modal__close:before {
  transform: rotate(-45deg);
}

.modal-btn {
  cursor: pointer;
}

/*** Mobile Responsive ***/
@media screen and (max-width: 768px) {
  .modal__inner {
    width: 90%;
    height: 90%;
    box-sizing: border-box;
  }
}

@media (max-width: 415px) {
  .tab label {
    padding: 7px 10px;
  }
}

